import { BrowserRouter, Routes, Route } from 'react-router-dom'

// pages and components
import Home from './pages/Home'
import Kanji from './pages/Kanji'
import Navbar from './components/Navbar'
// import { KanjiContextProvider } from './context/KanjiContext';
import { createContext } from 'react'

export const KanjiContext = React.createContext(null);

function App() {
  return (
    <div className="App">
      <KanjiContextProvider>
        <BrowserRouter basename="/">
          <Navbar />
          <div className="pages">
            <Routes>
              <Route
                path="/"
                element={<Home />}
              />
              <Route
                path="/:id"
                element={<Kanji />}
              />
            </Routes>
          </div>
        </BrowserRouter>
      </KanjiContextProvider>
    </div>
  );
}

export default App;
